  false,\n\t\"url\": null,\n\t\"notes\": \"This is the 1982 fire management plan for
  Stillwater Wildlife Management Area.  The plan outlines general fire management,
  prescribed burning, and wildfires.  Scirpus/thypa stands are too thick for wildlife
  nesting, and will be removed by prescribed burning in the Lower Foxtail Unit and
  the west part of the Nutgrass Unit.  In the event that one of these areas ignites
  outside of the prescribed burning plan, the fire will not be extinguished.  There
  has not been a wildfire in the Wildlife Management Area since its establishment.\",\n\t\"owner_org\":
